import React from "react";
import "./App.css";
import { Header } from "./layout/header";
import { Footer } from "./layout/footer";
import { Main } from "./layout/Mainain";
import { Movies } from "./components/Movies";
import { Movie } from "./components/Movie";

function App() {
  return (
    <React.Fragment>
      <Header />
      <Main />
      <Movies/>
      <Movie/>
      <Footer />
    </React.Fragment>
  );
}

export default App;
